The expression in the image is a simple algebraic equation involving the variables $x$ and $y$. It can be written in LaTeX format as follows:

$$
\begin{aligned}
x^2+y^2 & =3^2 \\
x^2+y^2 & =9 \\
x^2 & =9-y^2 \\
x & =\sqrt{9-y^2}
\end{aligned}
$$

This expression shows the relationship between the variables $x$ and $y$ and the constant $3$.

The expression in the image is a part of a mathematical problem involving a quadratic equation. It is written in a standard format, which can be represented in LaTeX as follows:

$$
\begin{aligned}
& \frac{1}{2} x^2 - 1 = 0 \\
& x = \pm \sqrt{1}
\end{aligned}
$$

This expression represents the solutions to the quadratic equation $1/2 x^2 - 1 = 0$, which are $x = \pm \sqrt{1}$.

The expression in the image is a part of a mathematical problem involving the calculation of the value of $x$ in the equation $x^2 - 3 = 2$. To write it in LaTeX format, we can use the following code:

$$
\begin{aligned}
x^2 - 3 & = 2 \\
x^2 & = 5 \\
x & = \sqrt{5}
\end{aligned}
$$

This LaTeX code represents the steps taken to solve the equation $x^2 - 3 = 2$ and find the value of $x$.

The image shows a chemical formula written in a shorthand notation. To express it in LaTeX format, we can use the 'chemistry' package and the 'mh' command for the molecular formula. Here's the LaTeX expression:

$$
\begin{aligned}
\ce{Mg(OH)_2} & =\ce{Mg^2+ + 2OH-} \\
& =\ce{Mg^2+ + 2H_2O}
\end{aligned}
$$

This expression represents the chemical formula for magnesium hydroxide, which is a compound of magnesium, hydrogen, and oxygen.

The expression in the image is a part of a trigonometric identity involving the sine function. It can be written in LaTeX format as:

\begin{aligned}
\sin \theta &= \frac{1}{2} \sin (2 \theta) \\
&= \frac{1}{2} \left(\frac{\pi}{4}\right)^2 \\
&= \frac{\sqrt{2}}{2}
\end{aligned}

This expression shows that the sine of an angle is equal to half the sine of twice that angle, with the angle being $\frac{\pi}{4}$ radians.
